import React from "react";
import classes from "./Items.module.css";

export default function Navigation({ name, price, img_url }) {
  return (
    <div className={classes.item}>
      <p className={classes.name} dangerouslySetInnerHTML={name} />
      <img alt="" src={img_url}></img>
      <button>{price}</button>
    </div>
  );
}
